import React from "react";
import  "./home.css"
import HeroImage from '../../assets/img/hero.png';
import VideoImage from '../../assets/img/video-image.png';


function Home(){
    return (
        <div id="home">
            <div className="container">
            <div className="left">
                <h1>Alkimi Akademi</h1>
                <p>This is some text I will write later</p>
            </div>
            <div className="right">
            <img src={HeroImage} alt="metamask logo"></img>
            </div>
            </div>
            <div class="intro">
            <img src={VideoImage} alt="metamask logo"></img>
            <h1>Hello this is the intro</h1>
            </div>
        </div>
      );
}

export default Home;
